Informal_Propositions:
1. Each face is a face surface;
 2. Each face surface has its geometry defined by an elementary surface, swept surface or a b-spline surface;
 3. The edges used to define the boundaries of the face shall all reference an edge curve
 4. Each curve used to define the geometry of the faces and face bounds shall be either a conic, or a line or a polyline or a b-spline curve
 5. The edges used to define the face boundaries shall all be trimmed by vertices of type vertex point
 6. No loop used to define a face bound shall be of the oriented subtype

1. If Closed = TRUE, the same topological constraints as imposed by an faceted boundary representation shall be safisfied. In particular:
 -each face shall be unique;
 -each edge shall be used by exactly two outer or inner boundaries of faces;
 -the topological normal at each point on the boundary of the polygonal face set shall point away from the material of the solid.

If Closed = TRUE, the same topological constraints as imposed by an faceted boundary representation shall be safisfied. In particular:
 -each face shall be unique;
 -each edge shall be used by exactly two boundaries of faces;
 -the topological normal at each point on the boundary of the triangulated face set shall point away from the mater ial of the solid.
